val y = x.partitionBy(new Partitioner() { val numPartitions = 2 def getPartition(k:Any) = { if (k.asInstanceOf[Char] < 'H') 0 else 1 }
}) x: org.apache.spark.rdd.RDD[(Char, String)] = ParallelCollectionRDD[328] at parallelize at <console>:37
